	protected void login(HttpClient client, Map<String, String> loginParams) throws Exception {
		client = WebUtil.getDefaultHttpClient();
		
		loginNme=loginParams.get("username");
		loginpassword=loginParams.get("password");		
		
		Map<String, String> params=new HashMap<String, String>();
		params.put("username", loginNme);
		params.put("password", loginpassword);
		params.put("vrifyCode","");
		params.put("grant_type","password");
		
		Map<String, String> headers=new HashMap<String, String>();
		headers.put("Accept", "application/json, text/plain, */*");
		headers.put("Accept-Encoding", "gzip, deflate");
		headers.put("Accept-Language", "zh-CN,zh;q=0.9,en;q=0.8");
		
		headers.put("User-Agent", "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36");
//		headers.put("User-Agent", "Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/86.0.4240.198 Safari/537.36");
		headers.put("Content-Type", "application/x-www-form-urlencoded;charset=UTF-8");
		String encoding = DatatypeConverter.printBase64Binary("hxyxt_pc:admin".getBytes("UTF-8"));
		headers.put("Authorization", "Basic " + encoding);//hxyxt_pc:admin  的base64加密
		String str=WebUtil.repeatPostByHeader(client, params, headers, "http://supplier.yxtmart.cn/oauth/token");
		JSONObject object=JSONObject.parseObject(str);
		String access_token = object.getString("access_token");
		
		params.clear();
//		wxType	2
//		userIds	10422601
		params.put("wxType","2");
		params.put("userIds",loginNme);
//		Authorization: bearer 3e5f9ae03b5242b68f94e61e9e8593c8
		headers.put("Authorization", "bearer " + access_token);
		str=WebUtil.repeatPostByHeader(client, params,headers, "http://supplier.yxtmart.cn/api/wx/check_bind_infos");
		object=JSONObject.parseObject(str);
		/*if(object.containsKey("code")){
			if(object.getInteger("code")==400){
				logger.error(orgCode+orgName+"登录失败！用户名或者密码错误");
			}else{
				logger.error(orgCode+orgName+"登录失败！");
			}
			loginsuccess=false;
		}*/
		if(object.getInteger("code")==1){
			loginsuccess=true;
		}
	}
	
