	protected void getContentsIndex(String[] title,String[] contents){
		for(int i=0;i<contents.length;i++){
			if(contents[i].equals("")){
				continue;
			}else{
				for(int j=0;j<title.length;j++){
					if(title[j].equals(contents[i])){
						contents[i]=j+"";
						break;
					}
				}
			}
		}
	}


